import React from "react";

import styles from "./Header.module.css";
import HeaderCartButton from '../HeaderCartButton/HeaderCartButton';
// Header Component
const Header = (props) => {
  return (
    <React.Fragment>
      <header className={styles.header}>
        <h1>ReactMeals</h1>
        <HeaderCartButton/>
      </header>
      <div>
        <img></img>
      </div>
    </React.Fragment>
  );
};

export default Header;
